import{_ as p,o as e,c as a,a as t}from"./app.4542bc3b.js";const r={},c=t('<blockquote><p>\u5E0C\u671B\u548C\u60B2\u4F24\uFF0C\u90FD\u662F\u4E00\u7F15\u5149</p><p>\u603B\u6709\u4E00\u5929\uFF0C\u6211\u4EEC\u4F1A\u518D\u76F8\u9047</p></blockquote><h2 id="\u6211\u7231\u7684\u5973\u5B69\u4E0D\u662F\u7231\u6211\u7684\u5973\u5B69" tabindex="-1"><a class="header-anchor" href="#\u6211\u7231\u7684\u5973\u5B69\u4E0D\u662F\u7231\u6211\u7684\u5973\u5B69" aria-hidden="true">#</a> \u6211\u7231\u7684\u5973\u5B69\u4E0D\u662F\u7231\u6211\u7684\u5973\u5B69</h2><p>\u61E6\u5F31\u65E0\u80FD\u5982\u6211</p><p>\u5373\u4F7F\u662F\u5EA6\u8FC7\u4E86\u9752\u6625\u6700\u540E\u7684\u5C81\u6708</p><p>\u4E5F\u6CA1\u660E\u767D\u7231\u60C5\u662F\u4EC0\u4E48</p><p>\u53EF\u53C8\u6709\u8C01\u61C2\u5F97\u4EC0\u4E48\u662F\u7231\u60C5</p><h2 id="\u7231\u6211\u7684\u5973\u5B69\u8D70\u4E22\u4E86" tabindex="-1"><a class="header-anchor" href="#\u7231\u6211\u7684\u5973\u5B69\u8D70\u4E22\u4E86" aria-hidden="true">#</a> \u7231\u6211\u7684\u5973\u5B69\u8D70\u4E22\u4E86</h2><p>\u90A3\u4E9B\u5E74\u4E00\u5B9A\u6709\u4E2A\u7231\u6211\u7684\u5973\u5B69</p><p>\u53EF\u6211\u628A\u5979\u5F04\u4E22\u4E86</p><h2 id="\u6211\u4EEC\u7684\u6545\u4E8B" tabindex="-1"><a class="header-anchor" href="#\u6211\u4EEC\u7684\u6545\u4E8B" aria-hidden="true">#</a> \u6211\u4EEC\u7684\u6545\u4E8B</h2><p>\u6211\u662F\u4E61\u4E0B\u7684\u5B69\u5B50\uFF0C\u81EA\u5351\uFF0C\u80C6\u5C0F\uFF0C\u61E6\u5F31\uFF0C\u65E0\u77E5</p><p>\u53EF\u8FD9\u5E76\u4E0D\u662F\u56E0\u4E3A\u6211\u662F\u4E61\u4E0B\u7684\u5B69\u5B50</p><p>2014\u5E74\uFF0C\u6211\u79BB\u5F00\u5BB6\u4E61\u7B2C\u4E00\u6B21\u9047\u89C1\u5979</p><p>\u6211\u4ECD\u7136\u8BB0\u5F97\u90A3\u95F4\u6559\u5BA4\u91CC\u7684\u6668\u5149\uFF0C\u966A\u4F34\u7740\u6211\u4EEC\u6BCF\u4E00\u4E2A\u6E05\u6668</p><p>\u73ED\u91CC\u5728\u5435\u95F9\uFF0C\u4F60\u4E00\u8138\u6740\u6C14\u8BAD\u65A5\u4ED6\u4EBA\uFF0C\u6240\u6709\u4EBA\u5B89\u9759\u4E86\uFF0C\u4F46\u6211\u5374\u77E5\u9053\u4E86\u4E00\u4E2A\u51F6\u51F6\u7684\u5C0F\u5973\u5B69</p><p>\u53EF\u662F\u6751\u91CC\u6765\u7684\u5C0F\u5B69\uFF0C\u5411\u6765\u662F\u8D8B\u5409\u907F\u51F6\u7684\uFF0C\u6211\u53EA\u9053\uFF1A\u656C\u800C\u8FDC\u4E4B</p><p>\u6211\u4EEC\u7684\u4EA4\u96C6\uFF0C\u4ECE\u7B2C\u4E00\u6B21\u5206\u7EC4\u5F00\u59CB</p><p>\u4E09\u4E2A\u4EBA\u7684\u5C0F\u7EC4\uFF0C\u4F60\u8BF4\u7684\u624D\u7B97\uFF0C\u90A3\u65F6\u5019\u4F60\u53EF\u771F\u662F\u4E2A\u574F\u4EBA</p><p>\u53EF\u662F\u540E\u6765\uFF0C\u5373\u4F7F\u61F5\u61C2\u5982\u6211\uFF0C\u6211\u4E5F\u770B\u51FA\u4E86\u4F60\u773C\u91CC\u7684\u6B22\u559C</p><p>\u6211\u5047\u88C5\u4E0D\u77E5\uFF0C\u4F46\u4E0D\u77E5\u4EC0\u4E48\u65F6\u5019\uFF0C\u6211\u4E5F\u559C\u6B22\u4E0A\u4E86\u8FD9\u4E2A\u5201\u86EE\u5374\u6E29\u67D4\u5584\u826F\u7684\u5973\u5B69\u5B50</p><p>\u5979\u56DE\u5BB6\u4E0D\u5728\u65C1\u8FB9\uFF0C\u6211\u4F1A\u60F3\u5979\u4E3A\u4EC0\u4E48\u4E0D\u4E0A\u5B66</p><p>\u5979\u7A81\u7136\u56DE\u6765\uFF0C\u6211\u4F1A\u5047\u88C5\u4E0D\u5728\u610F</p><p>\u5979\u95EE\u6211\u8981\u559D\u8336\u5417\uFF0C\u6211\u8BF4\u4E0D\u8981\uFF0C\u4F46\u662F\u5FC3\u91CC\u5374\u5F88\u9AD8\u5174</p><p>\u6211\u77E5\u9053\u6211\u559C\u6B22\u5979\uFF0C\u4F46\u6211\u4E0D\u77E5\u9053\u8FD9\u662F\u4E0D\u662F\u7231</p><p>\u9752\u6DA9\u7684\u5C81\u6708\u91CC\uFF0C\u603B\u6709\u90A3\u4E48\u4E00\u6761\u94C1\u5F8B\uFF0C\u6211\u9000\u7F29\u4E86</p><p>\u4F60\u4E00\u5982\u65E2\u5F80\u7684\u6B3A\u8D1F\u4EBA\uFF0C\u6211\u5076\u5C14\u4E5F\u4F1A\u751F\u6C14\uFF0C\u4F46\u603B\u662F\u539F\u8C05\u4F60</p><p>\u65F6\u95F4\u5E76\u4E0D\u4F1A\u8BA9\u559C\u6B22\u6E10\u6E10\u6DE1\u53BB\uFF0C\u53EA\u4F1A\u8BA9\u559C\u6B22\u53D8\u5F97\u6DF1\u6C89</p><p>\u4F60\u603B\u662F\u559C\u6B22\u5403\u70B9\u4EC0\u4E48\uFF0C\u660E\u660E\u90FD\u80D6\u80D6\u7684\u5566\uFF0C</p><p>\u6211\u603B\u662F\u5E26\u7740\u4E9B\u7CD6\uFF0C\u53EF\u6211\u4ECE\u6765\u4E0D\u5403\uFF0C\u56E0\u4E3A\u4F60\u662F\u574F\u4EBA\u561B\uFF0C\u4F1A\u62A2\u8D70\u5B83\u4EEC\u7684</p><p>\u540E\u6765\uFF0C\u53D1\u751F\u4E86\u597D\u591A\u597D\u591A\u4E8B\u60C5</p><p>\u6211\u628A\u81EA\u5DF1\u5BF9\u4F60\u7684\u559C\u6B22\u5C31\u7740\u767D\u5F00\u6C34\u4E00\u70B9\u70B9\u541E\u54BD</p><p>\u4E5F\u628A\u81EA\u5DF1\u5BF9\u4F60\u7684\u559C\u6B22\u4E00\u70B9\u70B9\u6DF1\u57CB</p><hr><p>\u6211\u81EA\u8BE9\u4E0D\u51E1\uFF0C\u4F46\u6210\u7EE9\u8D8A\u6765\u8D8A\u5DEE</p><p>\u6211\u77E5\u9053\u81EA\u5DF1\u559C\u6B22\u4F60\uFF0C\u4F46\u6211\u4E0D\u77E5\u9053\u81EA\u5DF1\u5C06\u6765\u5728\u54EA\u91CC</p><p>\u6211\u77E5\u9053\u9AD8\u8003\u662F\u4E2A\u7EC8\u70B9\uFF0C\u4F46\u6211\u4E0D\u77E5\u9053\u7EC8\u70B9\u8FC7\u540E\uFF0C\u4F60\u5728\u54EA\u91CC</p><p>\u4E5F\u8BB8\uFF0C\u6211\u5728\u6CE5\u6F6D\u8150\u70C2\uFF0C\u800C\u4F60\u4E0D\u77E5\u53BB\u5411</p><p>\u6211\u8EB2\u7740\u4F60\uFF0C\u65E0\u89C6\u4F60\uFF0C\u9EBB\u75F9\u81EA\u5DF1\u5FD8\u4E86\u4F60\uFF0C\u5C01\u95ED\u81EA\u5DF1</p><p>\u6211\u770B\u4E86\u592A\u591A\u6545\u4E8B\uFF0C\u5E74\u8F7B\u7684\u6211\u4EEC\u4E0D\u61C2\u7231\u60C5\uFF0C\u53EF\u6545\u4E8B\u61C2\u5F97</p><p>\u6211\u60F3\uFF0C\u6211\u662F\u7231\u7740\u4F60\u7684</p><p>\u6211\u6DE1\u5FD8\u4E86\u4F60\u7684\u6A21\u6837\uFF0C\u8BB0\u5FC6\u91CC\u7684\u90A3\u4E9B\u4E8B\u4F60\u90FD\u5FD8\u4E86\uFF0C\u4E3A\u4EC0\u4E48\u6211\u8FD8\u8BB0\u5F97</p><p>\u6211\u8BD5\u7740\u7BA1\u675F\u81EA\u5DF1\u7684\u5C0F\u5FC3\u601D\uFF0C\u60F3\u4F60\u7684\u65F6\u5019\uFF0C\u4E0D\u53BB\u6253\u6270</p><p>\u6211\u771F\u7684\u6CA1\u4EC0\u4E48\u574F\u5FC3\u601D\uFF0C\u7231\u4E00\u4E2A\u4EBA\u600E\u4E48\u4F1A\u81EA\u79C1\u5462</p><p>\u4F60\u8BF4\u6211\u4E0D\u662F\u6B63\u7ECF\u4EBA\uFF0C\u6211\u53EA\u662F\u8BF4 \u662F\u5462\uFF0C\u6211\u600E\u4E48\u4F1A\u6B63\u7ECF\u5462</p><p>\u6211\u53EA\u662F\u544A\u8BC9\u81EA\u5DF1\uFF0C\u597D\u597D\u5730\u53BB\u966A\u4F60\u4E24\u5E74</p><p>\u53EF\u4F60\u5374\u8B66\u60D5\u5730\u50CF\u53EA\u5C0F\u5154\u5B50</p><p>\u6211\u95EE \u4F60\u662F\u4E0D\u662F\u8981\u628A\u6211\u5FD8\u4E86\uFF0C\u4F60\u8BF4\uFF0C\u4E0D\u662F</p><p>\u6211\u60F3\u554A\uFF0C\u771F\u597D\u554A</p><blockquote><p>\u559C\u6B22\u4E00\u4E2A\u4EBA\uFF0C\u4F1A\u628A\u81EA\u5DF1\u5351\u5FAE\u5230\u5C18\u57C3\u91CC\uFF0C\u7948\u76FC\u7740\u660E\u65E5\u82B1\u5F00\u3002</p><p>\u60F3\u6765\u4E00\u573A\u7D2B\u8272\u7684\u65E7\u68A6\uFF0C\u65E0\u5173\u5BF9\u9519\uFF0C\u53EA\u613F\u5B83\u4ECD\u5982\u8BB0\u5FC6\u4E2D\u7684\u508D\u665A\uFF0C\u6E29\u99A8\u4F9D\u65E7\u3002</p><p>\u8BE5\u600E\u4E48\u79F0\u547C\u4F60\uFF0C\u662F\u540C\u684C\u7684\u4F60\uFF0C\u8FD8\u662F\u80D6\u80D6\u7684\u4F60\u3002</p><p>\u4F60\u548C\u6211\u8BF4\uFF0C\u6211\u4E11\uFF0C\u4E0D\u8FC7\u662F\u56E0\u4E3A\u5B66\u4E60\u597D\u624D\u597D\u70B9\u3002\u56E0\u4E3A\u8FD9\u53E5\u8BDD\uFF0C\u6211\u8EB2\u7740\u4F60\u3002\u4F60\u90A3\u4E48\u6F02\u4EAE\uFF0C\u6211\u53C8\u90A3\u4E48\u81EA\u5351\u3002</p><p>\u4E0D\u77E5\u9053\u4EC0\u4E48\u65F6\u5019\uFF0C\u4F60\u662F\u6211\u7684\u5468\u5C0F\u80D6\u3002</p><p>\u6BCF\u5F53\u6211\u505C\u4E0B\u505A\u9898\u633A\u80F8\u6536\u62F3\uFF0C\u4F60\u4E5F\u603B\u662F\u8FD9\u6837\u8DDF\u7740\u505A\uFF0C\u641E\u5F97\u6211\u6CC4\u6C14\uFF0C\u4F60\u5374\u5728\u90A3\u7B11\u3002\u53EF\u7231\u7684\u5C0F\u59D1\u5A18\u3002</p><p>\u90A3\u65F6\u5019\u7684\u6211\uFF0C\u771F\u662F\u597D\u50BB\u3002</p><p>\u540E\u6765\uFF0C\u4F60\u53D8\u5F97\u6F02\u4EAE\u4E86</p><p>\u6211\u4E0D\u80FD\u82E5\u65E0\u5176\u4E8B\u7684\u770B\u7740\u4F60\u548C\u4E00\u7FA4\u7537\u751F\u8BF4\u8BF4\u7B11\u7B11</p><p>\u66F4\u4E0D\u80FD\u542C\u5230\u4ED6\u4EEC\u8BF4\u4F60\u7684\u4E0D\u662F</p><p>\u53EF\u6211\u4EC0\u4E48\u4E5F\u4E0D\u80FD\u505A</p><p>\u6211\u4E0D\u662F\u4F60\u7684\u67D0\u67D0\u67D0</p><p>\u5728\u4E00\u4E2A\u6587\u5316\u5C48\u4ECE\u6743\u52BF\u7684\u4F20\u7EDF\u4E2D\uFF0C\u5E84\u5B50\u662F\u4E00\u68F5\u5B64\u72EC\u7684\u6811\uFF0C\u662F\u4E00\u68F5\u5B64\u72EC\u5730\u5728\u6DF1\u591C\u770B\u5B88\u5FC3\u7075\u6708\u4EAE\u7684\u6811\u3002</p><p>\u4E00\u8F6E\u5B64\u6708\u4E4B\u4E0B\u4E00\u682A\u5B64\u72EC\u7684\u6811\uFF0C\u8FD9\u662F\u4E00\u79CD\u65E0\u6CD5\u4F01\u53CA\u7684\u59A9\u5A9A\u3002</p><p>\u5E84\u5B50\u4F3C\u56E0\u65E0\u60C5\u800C\u575A\u5F3A\uFF0C\u5B9E\u5219\u56E0\u6700\u591A\u60C5\u800C\u6700\u8106\u5F31\uFF01\u5E84\u5B50\u662F\u4EBA\u7C7B\u6700\u8106\u5F31\u7684\u5FC3\u7075\uFF0C\u6700\u6E29\u67D4\u7684\u5FC3\u7075\uFF0C\u6700\u654F\u611F\u56E0\u800C\u4E5F\u662F\u6700\u6613\u53D7\u5230\u4F24\u5BB3\u7684\u5FC3\u7075\u2026</p><p>\u5728\u4ED6\u8EAB\u4E0A\uFF0C\u6211\u4F3C\u4E4E\u770B\u5230\u4E86\u4EC0\u4E48\u3002</p><p>\u6211\u548C\u4F60\u8BF4\u7684\u8BDD\u8D8A\u6765\u8D8A\u5C11\uFF0C\u8BED\u6C14\u5374\u8D8A\u6765\u8D8A\u6E29\u67D4\u3002\u6211\u77E5\u9053\u6211\u7231\u4E0A\u4E86\u4F60\uFF0C\u4F46\u662F\u7231\u800C\u4E0D\u5F97</p><p>\u6015\u5C31\u6015\u7231\u5F97\u592A\u65E9\uFF0C\u4E0D\u80FD\u7EC8\u8001</p><p>\u4F60\u8BF4\uFF0C\u61C2\u6BD4\u7231\u91CD\u8981</p><p>\u4F60\u8BF4\uFF0C\u6B32\u8BF4\u8FD8\u4F11\uFF0C\u53EF\u6211\u5728\u7B49\u90A3\u6843\u82B1\u5F00\u6EE1\u5929\u6DAF</p><p>\u73B0\u5728\u5374\u53EA\u80FD\u662F \u591A\u5C11\u6B32\u8BF4\u8FD8\u4F11\u4E8B\uFF0C\u90FD\u4ED8\u4E88\u65E0\u5E38</p></blockquote>',49),o=[c];function h(d,n){return e(),a("div",null,o)}const s=p(r,[["render",h],["__file","Meet.html.vue"]]);export{s as default};
